`;

export const Music = () => (
  <Styles>
    <iframe src="https://open.spotify.com/embed/playlist/5WQ1R5lhETsnKz2bGcvsrN" width="300" height="80" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
